import MrKrabsCard from "./components/MrKrabsCard";
import friends from "./friends";
import Friendcard from "./components/Friendcard";



function App() {
  return (
    <Wrapper>
      <Title>Friends List bro</Title>

      <Friendcard name={'my name is songe bob '} cook={'i loke to cook dude'}/>


    </Wrapper>
  );
}




export default App;
